import React, { useContext } from "react";
import { NewsContext } from "../NewsContext";

const ArticleOpen = () => {
  const [Cards, setCards] = useContext(NewsContext);
  console.log(Cards);
  return (
    <div>
      <h1>{Cards.title}</h1>
      {Cards.map((cardd) => {
        <h1>{cardd.title}</h1>;
      })}
    </div>
  );
};

export default ArticleOpen;
